import logo from './logo.svg';
import './styles/App.css';
import LoginForm from './components/LoginPage';
import LoginPage from './components/LoginPage';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>Conversations</p>
      </header>
      <body>
        <LoginPage></LoginPage>
      </body>
    </div>
  );
}

export default App;
